e01-d53f-498f-9d87-2042d6f524ab','<p>- Chọn chức năng phù hợp với mẫu và hiện thực</p><p>- Ghi tài liệu</p>'),('bc3884ae-e246-4001-857c-b2ddd16ec442','1000001',_binary '\0',NULL,'2025-07-23 17:08:07.617769',NULL,'2025-07-23 17:08:07.617769','1000001','2025-02-23 17:00:00.000000','2025-02-21 17:00:00.000000','2025-02-16 17:00:00.000000',10,'Xử lý dữ liệu','f228ad1b-f250-41b6-ab6e-7979a8c78a52','<p>Thưc hiện tiền xử lý dữ liệu.</p><p>Báo cáo kết quả thu được ở cuối mỗi sprint</p>'),('be992de1-8f5a-4c5b-8158-2d7ae3c7ab38','1000001',_binary '\0',NULL,'2025-07-04 06:24:11.400982',NULL,'2025-07-04 06:24:11.400982','1000001','2025-04-03 17:00:00.000000','2025-03-23 17:00:00.000000','2025-03-20 17:00:00.000000',15,'Ứng dụng','88e830a7-f240-4d0f-b8f3-bd08cfb69607','<p>- Xây dựng giao diện ứng dụng để sử dụng mô hình (nếu có)</p><p>- Áp dụng mô hình vào dữ liệu thực tế, ghi nhận kết quả</p>'),('c469d85a-a19c-4411-88ca-c0041af4f8e5','1000003',_binary '\0',NULL,'2025-07-04 08:20:18.520837',NULL,'2025-07-04 08:20:18.520837','1000003','2025-02-14 17:00:00.000000','2025-02-09 17:00:00.000000','2025-02-08 17:00:00.000000',10,'Tìm hiểu công nghệ sử dụng','139b821a-f5d0-49c8-9f26-da68e54d59a2','<p>- Nền tảng phát triển Android hoặc IOS</p><p>- Lựa chọn đề tài (có phần admin để quản lý nếu là bài toán bán hàng)</p><p>- Phân tích usecase của đề tài, liệt kê các chức năng cần thiết</p><p>- Xây dựng quy tắc làm việc cho nhóm, thiết lập Version control</p>'),('ca990a18-1ecf-4677-b4f5-ff3f9c679fe3','1000002',_binary '\0',NULL,'2025-07-04 08:12:31.161494',NULL,'2025-07-04 08:12:31.161494','1000002','2025-05-02 17:00:00.000000','2025-04-28 17:00:00.000000','2025-04-26 17:00:00.000000',15,'Hiện thực các chức năng bổ sung','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Hiện thực review sản phẩm</p><p>- Điều chỉnh lại các UI của các phần đã làm</p><p>- Bổ sung các trang giới thiệu còn thiếu</p>'),('cd36124d-d149-4e1b-a716-63db9678cf63','1000001',_binary '\0',NULL,'2025-07-23 17:13:14.968207',NULL