siness nếu có</p><p>- Có thể lựa chọn đóng gói ứng dụng </p>'),('f87463f4-3d2c-49f1-9f20-a4510eb0728f','1000002',_binary '\0',NULL,'2025-07-04 07:34:14.409154',NULL,'2025-07-04 07:34:14.409154','1000002','2025-02-22 17:00:00.000000','2025-02-18 17:00:00.000000','2025-02-16 17:00:00.000000',16,'Chuẩn bị bài toán','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Lựa chọn lĩnh vực kinh doanh</p><p>- Thiết kế slide thuyết trình để trình bày dự án</p><p>- Lựa chọn công nghệ và nền tảng hiện thực</p><p>- Lựa chọn chức năng, vẽ usecase diagram</p>'),('f8bdf08c-c32d-4863-86b2-44a36a756fac','1000002',_binary '\0',NULL,'2025-07-04 07:57:06.189675',NULL,'2025-07-04 07:57:06.189675','1000002','2025-04-11 17:00:00.000000','2025-04-01 17:00:00.000000','2025-03-29 17:00:00.000000',20,'Hiện thực chức năng cho đơn hành  và thanh toán','792e6f85-582a-4f65-a50d-e7c59cefb7b2','<p>- Hiện thực giỏ hàng</p><p>- Tạo đơn hàng, ghi nhận lại các thông tin người nhận và không được thay đổi</p><p>- Lấy địa chỉ tỉnh thành, có thể lựa chọn tính giá vận chuyển</p><p>- Tích hợp thanh toán của ví điện từ phổ biến</p><p>- Trang quản lý đơn hàng cho khách hàng và admin</p><p>- Admin được thay đổi trạng thái đơn hàng với các ràng buộc</p>');
